import React from 'react'

const MenuCard = ({menuData}) => {
  console.log(menuData);
  return (
   <>
   <section className='main-card--container'>
   {menuData.map((currEle)= ()=>{
    return(
      <>
    <div className="card-container">
    <div className="card">
    <div className="card-body">
    <span className="card-number card-circle subtle"> 1  </span> 
    {/* <span className="card-author subtle" style= {{color: 'red'}}> Breakfast </span>  */}
    <span className="card-author subtle" /**style={myStyle}**/> Breakfast</span>
    <h2 className="card-title"> Maggie </h2>
    <span className="card-description subtle">
    The Maggi brand was originated from Switzerland in 1886.Julius Maggi was the person who behind this recipe.
    She created a recipe of flavours to bring added taste to meals. In 1947, due to some problems regarding 
    the ownership and corporate structure, Maggis company merged with the Nestlé company to form Nestlé-Alimentana 
     </span>
     <div className="card-read"> Read </div>
     {/* <img src={image} alt="images" className="card-media" />  */}
     <span className="card-tag subtle"> Order Now </span>
    </div>
    </div>
    </div>

      </>
    )
   })}
   </section>
   
    </>
  )
}

export default MenuCard
